import React from 'react'
import { Route, Routes } from 'react-router-dom';

const App=()=>{

    return(
        <Routes>
            <Route path="/" element={
                (<>
                    <div className='App'><h3>this is app</h3></div>
                </>)
            }/>
        </Routes>
    )
}

export default App;
